import '../App.css';
import React,{useState, useEffect} from "react";
import {useNavigate } from 'react-router-dom';
import axios from 'axios';
import hodu from '../giddyUpHodu.png'

function Mypage(){
    const [id, setId] = useState('')
    const [all, setAll] = useState(0)
    const [done, setDone] = useState(0)
    const navigate = useNavigate()
    useEffect(() => {
        //getData();
    }, [])

    const getData=()=>{
        axios.get('/getData')
        .then((res)=>{
            setId(res.data.id)
            setAll(res.data.all)
            setDone(res.data.comp)
        })
    }
    return(
        <div className='todo-container'>
            <h1 style = {{fontSize : 50}}>{id}'s Ho-Do List</h1>
            <div style={{textAlign : "center", marginTop: 30}}>
                <div>
                    <img style={{width:200, alignItems:'center'}}src={hodu}/>
                </div>
                <button className = 'purpleButton' style = {{marginTop: 20, height:50, fontSize:20, width:"20%"}} 
                onClick={()=>{navigate('/list')}}>Back</button>
            </div>
        </div>
    )
}

export default Mypage
